import { RouterModule, Routes } from '@angular/router';
import { NgModule } from '@angular/core';

import { PagesComponent } from './pages.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { ECommerceComponent } from './e-commerce/e-commerce.component';
import { NotFoundComponent } from './miscellaneous/not-found/not-found.component';

const routes: Routes = [
    {
        path: '',
        component: PagesComponent,
        children: [
            {
                path: 'dashboard',
                component: ECommerceComponent
            },
            {
                path: 'iot-dashboard',
                component: DashboardComponent
            },
            {
                path: 'ui-features',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./ui-features/ui-features.module')['UiFeaturesModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'modal-overlays',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./modal-overlays/modal-overlays.module')['ModalOverlaysModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'extra-components',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./extra-components/extra-components.module')['ExtraComponentsModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'bootstrap',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./bootstrap/bootstrap.module')['BootstrapModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'maps',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./maps/maps.module')['MapsModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'charts',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./charts/charts.module')['ChartsModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'editors',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./editors/editors.module')['EditorsModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'forms',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./forms/forms.module')['FormsModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'tables',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./tables/tables.module')['TablesModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: 'miscellaneous',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./miscellaneous/miscellaneous.module')['MiscellaneousModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
            },
            {
                path: '',
                redirectTo: 'dashboard',
                pathMatch: 'full'
            },
            {
                path: '**',
                component: NotFoundComponent
            }
        ]
    }
];

@NgModule({
    imports: [RouterModule.forChild(routes)],
    exports: [RouterModule]
})
export class PagesRoutingModule {}
